var midDate = result.rows[Math.floor(result.rows.length/2)].start.getTime();
for (var i = 0; i < result.rows.length; i++) {
    var row = result.rows[i];
    row.start = row.start.getTime() +  (Date.now() - midDate);
    row.end = row.end.getTime() + (Date.now() - midDate);
}
